import React from "react";
import { useParams } from "react-router-dom";

const EventDetailPage = () => {
  const params = useParams();

  return (
    <>
      <div className="center">
        <h1>EventDetailPage</h1>
        <h3>{params.eventId}</h3>
      </div>
    </>
  );
};

export default EventDetailPage;
